INSERT INTO `cbkkgdvlt` VALUES (3,'1491790816','4201687502_1491790384','4201687502','2017-01-19','Số 03/TBG',' so 01/TBG ','2016-05-30','2017-01-29','Trần Thị Thanh Thúy - ĐT: 0583525095','2017-04-10','3',' Mức kê khai giá trên đã bao gồm thuế GTGT','2017-04-10 09:22:07',NULL,'Đang công bố','7','2017-04-10 02:53:58','2017-04-10 02:53:58',NULL,NULL),(9,'1491793722',' 4201623788_1491792507',' 4201623788','2017-01-24','08/2017/CTY','07/2017/CTY','2017-01-03','2017-01-28','Lê Thị Thịnh - ĐT: 058.3872020','2017-04-10','9',' Mức kê khai trên đã bao gồm thuế GTGT\r\n- Mức giá kê khai nêu trên quy định số khách lưu trú tối đa là 02 người + 01 trẻ em/ 1 phòng lưu trú loại 1 + loại 2\r\nNếu vượt quá số người quy định khách sạn sẽ phụ thu đối với số khách ở vượt là:\r\n+ Người lơn: 60.000 đồng/ 01 người\r\n+ Trẻ em: 30.000 đồng/ 1 người ','2017-04-10 10:10:57',NULL,'Đang công bố','17','2017-04-10 03:13:53','2017-04-10 03:13:53',NULL,NULL),(11,'1491794147','4200286219_1491790878','4200286219','2017-01-17','35/KKG','34/KKG','2017-01-17','2017-02-03','DNTN-TB','2017-04-10','11','- Mức giá trên bao gồm thuế GTGT.\r\n- Nếu khách hàng ở quá số người khách sạn sẽ phụ thu:\r\nĐối với khách vượt phòng ở phòng loại 1 là 200.000 đồng/người.\r\nĐối với khách vượt phòng ở phòng loại 2 là 150.000 đồng/người.\r\nĐối với khách vượt phòng ở phòng loại 3 là 100.000 đồng/người.\r\n-	Cơ sở kinh doanh chúng tôi cam kết thực hiện niêm yết giá và bán theo giá niêm yết. Nếu sai, cơ sở chúng tôi xin chịu trách nhiệm trước pháp luật.\r\n-	Khi cần quý khách có thể liên hệ với chúng tôi theo các số điện thoại sau, nếu cơ sở chúng tôi không thực hiện đúng bảng giá đã niêm yết:\r\nSở Tài chính Khánh Hòa: 058.3822072 ( Phòng Thanh tra) – 058.3826741 ( Phòng vaath giá)\r\nSở Văn hóa, Thể thao và Du lịch: 058. 3811871 ( Phòng Thanh tra)\r\nChi cục thuế TP Nha Trang: 058.3562181\r\n','2017-04-10 10:15:58',NULL,'Đang công bố','21','2017-04-10 03:16:12','2017-04-10 03:16:12',NULL,NULL),(17,'1491800039',' 4200284