INSERT INTO `kkdvvtxtx` VALUES (1,' 4200284356',' 4200284356_1491800809','1301/2016/CV.ASC','2016-01-13','1109/2015/CV.ASC','2015-09-11','2016-01-14',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Chờ chuyển','','- Giá xăng từ thời điểm điều chỉnh giá gần nhất 15/09/2015 đến ngày 04/01/2016 đã tăng 02 lần , giảm 06 lần  với tổng cộng giảm 1.320 đồng/lit, chiếm tỷ lệ giảm 7,5%.\r\n- Giá vật tư tăng do Ngân hằng Nhà nước điều chỉnh tỷ giá ngoại tệ: vật tư cho xe ô tô đa số phải nhập khẩu.\r\n- Từ 01/01/2016 chi phí lương cho người lao động tăng do chính phủ điều chỉnh mức lương tối thiểu vùng theo  NĐ 122/2015/NĐ-CP.\r\n- Từ 01/01/2016 chi phí đóng BHXH cho người lao động tăng do quy định của luật BHXH','7654321','2017-04-10 05:06:49','2017-04-10 05:06:49'),(2,' 4201601110',' 4201601110_1491803959','03/2016/KKGC','2016-04-11','02/2016/KKGC',NULL,'2016-04-16','Hưởng - 058333333',NULL,NULL,'2017-04-10','3','2017-04-10 17:10:34',NULL,'Duyệt','DO xác định chuyến Nha Trang - Sân bay Cam Ranh là tuyến chiến lược, nhu cầu khách hàng nhiếu nên công ty tính mức giá ưu đãi hơn mức giá tính trên đồng hồ.','Do tình hình biến động thị trường, giá xăng giảm tác động đến các doanh nghiệp kinh doanh vận tải nói chung và kinh doanh vận tải taxi nói riêng.\r\nNguyên nhân chênh lệch giữa dòng xe 4 chỗ, 7 chỗ do chất lượng từng dòng xe khác nhau dẫn đến giá thành khác nhau.','7654321','2017-04-10 05:59:19','2017-04-10 10:22:38'),(3,'123456','123456_1491984282','12','2017-04-12','',NULL,'2017-11-11','ry','424','ewwe','2017-04-12','13','2017-04-12 15:12:31','1491982861','Duyệt','','','7654321','2017-04-12 08:04:42','2017-04-12 08:25:48');
